import * as React from 'react';
import App from '../../src/App'
import { applicants } from '../../src/views/applicants'
import { mount } from '@cypress/react';

it('testing if rendering', () => {
    mount(<applicants />);
    cy.get('thisApplicant').contains(/Applicants/i).should('be.visible');
});
